const Navbar = () => {

  return (
    <header>
        <nav></nav>
     <div>
        <ul class="left hide-on-med-and-down">
            <li href='/dashboard'>Dashboard</li>
            <li href='/about'>About US</li>
            <li href='/contact'>Contact US</li>
        </ul>
     </div>

    </header>
  );
};

export default Navbar;
